import React, { useEffect, useState } from 'react';
import { Link, useParams } from 'react-router-dom';

const MemeDetails = () => {
  const [name,setName] = useState('default name');
  const {id} = useParams();

  return (
    <div>
      <h4> {name} </h4>
      <h4> {id} </h4>
      <Link to="/" className='btn'>
        Back to memes
      </Link>
    </div>
  );
};

export default MemeDetails;
